// 初始化饼图1 
function initPerformContractPie1() {
	
	var myChart = echarts.init(document.getElementById('performContractPie1'));

    // 指定图表的配置项和数据
    var option = {
	    tooltip: {
	        trigger: 'item',
	        formatter: "{b}： {c} ({d}%)"
	    },
	    legend: {
	        orient: 'vertical',
	        x: 'center',
	        width: 180,
	        orient: 'horizontal',
	        data:['家客','维系','渠道','大客户','营业', '商企', '乡镇', '校园']
	    },
	    graphic:{
            type:'text',
            left:'center',
            top:'60%',
            style:{
                text: peacock.sum(pieData),
                textAlign:'center',
                fill:'#3e3e3e',
                font: '22px "微软雅黑"'
            },
            onclick: function() {
            	// 点击第一个饼图的总量，所有图形恢复默认状态
            	// 第二个饼图恢复默认
				pieData2 = defaultPieData2;
				initPerformContractPie2();
				
				// 柱状图恢复默认
				barData = defaultBarData;
				initCompleteBar();
				
				// 散点图恢复默认
				scatterData = defaultScatterData;
				initScatterChart();
            }
        },
        color: ['#90c8af', '#d58264', '#5bb0f0', '#ffb880', '#d97a80', '#97b553', '#e6cf0d', '#f0fbc3'],
	    series: [
	        {
	            name:'专业线',
	            type:'pie',
	            center: ['50%', '62%'],
	            radius: ['35%', '50%'],
	            avoidLabelOverlap: false,
	            label: {
	                normal: {
	                    show: true,
	                    formatter: '{b}'
	                },
	                emphasis: {
	                    show: true,
	                    position : 'center',
	                    textStyle: {
	                        fontSize: '20',
	                        fontWeight: 'bold'
	                    }
	                }
	            },
	            labelLine: {
	                normal: {
	                    show: true
	                }
	            },
	            data: pieData
	        }
	    ]
	};

    // 使用刚指定的配置项和数据显示图表。
    myChart.setOption(option);
    
    // 自适应
    $(window).resize(function() {
    	myChart.resize();
    })
    
    //添加点击事件（单击），还有其他鼠标事件和键盘事件等等
    myChart.on('click', function (param){    
    	// 第二个饼图联动
		pieData2 = pieData[param.dataIndex].childrenPie;
		initPerformContractPie2();
		
		// 柱状图联动
		barData = pieData[param.dataIndex].childrenBar;
		initCompleteBar();
		
		// 散点图联动
		scatterData = pieData[param.dataIndex].childrenScatter;
		initScatterChart();
    });
}

